import React from 'react';
import logo from './logo.svg';
import './index.css';

function App() {
  return (
    <div className="App">
      <header className="header">
        <label cla>Portfolio</label>
        <ul className="">
          <li>Home</li>
          <li>Contact</li>
          <li>Skills</li>
          <li>Experience</li>
        </ul>
      </header>
    </div>
  );
}

export default App;
